window.bookSummaryJSON = "<p>Maceo Dillinger is the second eldest son of the Dillinger clan. Being a part of his family organization means Maceo is no stranger to danger, but he as a secret that might just cost him his life. He’s taken on an unapproved caseload and has brought his girlfriend Sharina Gladden along for the ride.</p> <p>His already dangerous world turns treacherous when Maceo finds himself as a target. The time for keeping secrets is over as escalating threats become increasingly deadly. Maceo is forced to come clean and rely on his family to ensure both his and Sharina’s survival.</p> <p>When the world gets dark, sometimes you need more than bulletproof vests and backup plans. With Maceo and Sharina living on borrowed time, every second has to count. Who will survive and who will meet a most tragic demise?</p>"; 
